import React from "react";
import "./MainBody.css";
import "./CardToggle";
import Card from "./Card";

function MainBody() {
  return (
    <div className="mainContainer">
      <div className="mainGrid">
        <Card title="Bio" />
        <div className="itemContainer cardTitle cardHidden">
          <h1>Timeline</h1>
        </div>
        <div className="itemContainer cardTitle cardHidden">
          <h1>Skillset</h1>
        </div>
        <div className="itemContainer cardTitle cardHidden">
          <h1>Links</h1>
        </div>
        <div className="itemContainer  cardTitle cardHidden">
          <h1>CV</h1>
        </div>
        <div className="itemContainer cardTitle cardHidden">
          <h1>Socials</h1>
        </div>
      </div>
    </div>
  );
}

export default MainBody;
